chrome.runtime.sendMessage = function (request, callback) {
  if (!request) request = { msg: 'blank request' }
  // onsole.log('simulated sendMessage with ', request.msg)
  let resp = {}
  if (request.msg === 'newHighlight') {
    // { url: window.location.href, hlightIdentifier: hlightIdentifier, highlight: theHighlight, msg: 'newHighlight' },
    window.webkit.messageHandlers.newHighlight.postMessage(request)
    resp = { test: 'got request for newHighlight' }
  } else if (request.msg === 'newPageInfoForIosApp') {
    // { url: window.location.href, hlightIdentifier: hlightIdentifier, highlight: theHighlight, msg: 'newHighlight' },
    window.webkit.messageHandlers.newPageInfoForIosApp.postMessage(request)
    resp = { test: 'got request for newPageInfoForIosApp' }
  } else if (request.msg === 'setHColor') {
    window.webkit.messageHandlers.setHColor.postMessage(request)
    resp = { probablySuccess: true, test: 'got request for setting hcolor' }
  } else if (request.msg === 'changeHlightColor') {
    window.webkit.messageHandlers.changeHlightColor.postMessage(request)
    resp = { probablySuccess: true, test: 'got request for changeHlightColor' }
  } else if (request.msg === 'addHLightComment') {
    window.webkit.messageHandlers.addHLightComment.postMessage(request)
    resp = { probablySuccess: true, test: 'got request for addHLightComment' }
  } else if (request.msg === 'hlightDisplayErr') {
    window.webkit.messageHandlers.hlightDisplayErr.postMessage(request)
    resp = { probablySuccess: true, test: 'got request for addHLightComment' }
  } else if (request.msg === 'removeHighlight') {
    window.webkit.messageHandlers.removeHighlight.postMessage(request)
    resp = { probablySuccess: true, test: 'got request for removeHighlight' }
  } else {
    resp = { error: ('invalid message ' + request.msg) }
  }
  callback(resp)
}

