var vulogTap = {
  start: {},
  lastEnd: {},
  count: 0,
  areCloseToEachOther: function (evt1, evt2) {
    // onsole.log('vents, diffs', evt1, evt2, (evt1.pageX - evt2.pageX), (evt1.pageY - evt2.pageY))
    return (Math.abs(evt1.pageX - evt2.pageX) < 10 && Math.abs(evt1.pageY - evt2.pageY) < 10)
  }
}

window.addEventListener('touchend', function (evt) {
  const now = new Date().getTime()
  const innerTimeChg = now - (vulogTap.start.time || 0)
  const outerTimeChg = now - (vulogTap.lastEnd.time || 0)
  if (innerTimeChg < 200 && vulogTap.areCloseToEachOther(evt, vulogTap.start)) {
    if (vulogTap.count === 0) {
      vulogTap.count++
    } else if (outerTimeChg < 500 && vulogTap.areCloseToEachOther(evt, vulogTap.lastEnd)) {
      vulogTap.count++
    } else {
      // onsole.log('not adding to tap ', outerTimeChg, vulogTap.areCloseToEachOther(evt, vulogTap.lastEnd))
    }
    vulogTap.lastEnd.time = new Date().getTime()
    vulogTap.lastEnd.pageY = evt.pageY
    vulogTap.lastEnd.pageX = evt.pageX

    if (vulogTap.count === 1) {
      window.webkit.messageHandlers.singleTap.postMessage({ url: window.location.href })
      // const resp = { test: 'got request for singleTap' }
    } else if (vulogTap.count === 2) {
      window.webkit.messageHandlers.doubleTap.postMessage({ url: window.location.href })
      // const resp = { test: 'got request for doubleTap' }
      vulogTap.count = 0
      vulogTap.start = {}
    }
  } else {
    vulogTap.count = 0
    vulogTap.start = {}
  }
})
window.addEventListener('touchstart', function (evt) {
  vulogTap.start.time = new Date().getTime()
  vulogTap.start.pageY = evt.pageY
  vulogTap.start.pageX = evt.pageX
})

